import React from 'react'
import { Box, Typography } from "@mui/material";
import { styled } from "@mui/system";
import ibrahim from "../assets/images/ibrahim.png";
import ahmad from "../assets/images/ahmad.png";


const Wrapper = styled(Box)({
    minHeight: "calc(100vh - 120px)",
});

const ContentWrapper = styled(Box)({
    padding: "50px",
});
const Doctors = () => {
    return (
        <>
            <Wrapper>
                <ContentWrapper>
                    <Typography variant="h3" sx={{ textAlign: "center", mb: "50px" }}>
                        Our Doctors
                    </Typography>
                    <Box sx={{ display: "flex", justifyContent: "center" }}>
                        <Box sx={{ mr: "50px" }}>
                            <img src={ibrahim} alt="Ibrahim" />
                            <Typography variant="h5" sx={{ textAlign: "center", mt: "10px" }}>
                                Dr. Ibrahim
                            </Typography>
                            <Typography variant="body1" sx={{ textAlign: "center" }}>
                                Specializes in Cardiology
                            </Typography>
                        </Box>
                        <Box>
                            <img src={ahmad} alt="Ahmad" />
                            <Typography variant="h5" sx={{ textAlign: "center", mt: "10px" }}>
                                Dr. Ahmad
                            </Typography>
                            <Typography variant="body1" sx={{ textAlign: "center" }}>
                                Specializes in Pediatrics
                            </Typography>
                        </Box>
                    </Box>
                </ContentWrapper>
            </Wrapper>
        </>
    );
};

export default Doctors;
